from gymnasium.envs.classic_control.cartpole import CartPoleEnv
from gymnasium import spaces
import numpy as np

class CustomCartPoleEnv(CartPoleEnv):
    def get_state(self) -> np.ndarray:
        # Compute the observation
        # swing threshold is just a constant that is added to the state for the ease of access.
        return np.array([self.cart_position, self.cart_velocity, self.pole_angle, self.pole_angular_velocity, self.swing_threshold, 1.0 if self.has_touched_left_threshold else 0.0, 1.0 if self.has_touched_right_threshold else 0.0])
    . Write a reward function for the following task: To balance a pole on a cart such that all of the following conditions are met: (1) The pole remains balanced and does not fall, staying within 1.57 radians of the vertical line. (2) The cart can move back and forth periodically between positions of -swing_threshold and swing_threshold as quickly as possible. (3) The game fails if the pole's angle exceeds 1.57 radians from the vertical line or if the cart moves outside the range of [-4.0, 4.0]. The swing_threshold is guaranteed to fall within this range..
